    },
    {
      phoneNumber: '4151218782',
      message: 'This is the code 4321 to verify your account'
    }
  ];

jobs.forEach((data) => {
    const job = queue.create('push_notification_code_2', data).save((err) => {
        if (!err) {
            console.log(`Notification job created: ${job.id}`);
        }
